function vol = DoubleIntegral()  i = 0;  j = 0;  sum = 0.0;  vol = 0.0;  x = 0.0;  y = 0.0;  n = 5000;  #r = zeros(2, n);  iprt = 1000;  f = @(x, y) sin(sqrt(log(x + y + 1)));  #r(1:2*n) = rand(2*n);  r = rand(2, n);  format('long');  for i = 1:n    x = r(1, i);    y = r(2, i);    if((x - 0.5).^2 + (y - 0.5).^2 <= 0.25)      j = j + 1;      sum = sum + f(x, y);      if(mod(j, iprt) == 0)        vol = (pi / 4)*(sum/double(j));        printf("j = %d, vol = %f\n", j, vol)        endif;      endif;    endfor;  vol = (pi / 4)*(sum/double(j));  printf("j = %d, vol = %f\n", j, vol)  endfunction